import React, { Component } from 'react';
import HomeSlider from '../../components/HomeSlider/HomeSlider';
import Usluge from '../../components/sectionss/sectionsPocetna/Usluge/Usluge';
import ZastoIzabratiNas from '../../components/sectionss/sectionsPocetna/ZastoIzabratiNas/ZastoIzabratiNas';
import Partneri from '../../components/sectionss/sectionsPocetna/Partneri/Partneri';
import Mapa from '../../components/sectionss/sectionsPocetna/Mapa/Mapa';
import Newsletter from '../../components/sectionss/sectionsPocetna/Sections/Newsletter/Newsletter';
import Footer from '../../components/sectionss/sectionsPocetna/Footer/Footer';

export default class Pocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<HomeSlider />
				<Usluge />
				<ZastoIzabratiNas />
				<Partneri />
				<Mapa />
				<Newsletter />
				<Footer />
			</React.Fragment>
		);
	}
}
